class Heart{constructor(t){this.aaf=0,this.vaf=0,this._model=t}modelStep(){this.is_enabled&&this.modelCycle()}modelCycle(){const t=this._model["modeling_stepsize"];let e=this._model.components.ecg["ncc_atrial"],o=this._model.components.ecg["cqt_time"],s=this._model.components.ecg["ncc_ventricular"],c=this._model.components.ecg["cqt_time"]+this._model.components.ecg["qrs_time"];this.aaf=e>=0&&e<o/t?Math.pow(Math.sin(Math.PI*(e/o)*t),2):0,this.vaf=s>=0&&s<c/t?Math.pow(Math.sin(Math.PI*(s/c)*t),2):0,this._model.components.ecg["ncc_atrial"]+=1,this._model.components.ecg["ncc_ventricular"]+=1,this._model.components["RA"].el_act=this.aaf,this._model.components["RV"].el_act=this.vaf,this._model.components["LA"].el_act=this.aaf,this._model.components["LV"].el_act=this.vaf}}